var input = document.getElementById("search_input"),
    intervalo;

input.addEventListener("keyup", function() {
    var busqueda = "";
    busqueda += '<li>'
    busqueda += '    <a href="#">'
    busqueda += '        <div class="row">'
    busqueda += '           <div class="col-xs-12 col-md-12 text-busq">'
    busqueda += '                <span class="busq-title">Buscando...</span>'
    busqueda += '            </div>'
    busqueda += '        </div>'
    busqueda += '    </a>'
    busqueda += '</li>'

    $("#busq-resultados").html(busqueda);
    $("#busq-resultados").css("display", "block");

    clearInterval(intervalo);
    intervalo = setInterval(function() {

        var url = $('#search_input').attr('url');
        var busqueda = $('#search_input').val();

        if (busqueda !== '') {
            $.post(url, {
                "busqueda": busqueda
            }, function(response) {
                if (response.success) {
                    $("#busq-resultados").html(response.html);
                    $("#busq-resultados").css("display", "block");
                } else {
                    $("#busq-resultados").html(response.html);
                    $("#busq-resultados").css("display", "block");
                }
            }, 'json');
        } else {
            $("#busq-resultados").css("display", "none");
        }

        clearInterval(intervalo);
    }, 1500);
}, false);



