function searchEnter() {
    var search = $('#search_input').val();
    if (search !== '') {
        if ($('#busq-resultados').css('display') == 'block') {
            search = search.replace("&", "");
            top.location = window.location.protocol + '//' + window.location.host + '/catalogo/?busq=' + search;
        }
    }
}
